The smallweb configuration can be defined in a smallweb.json[c] file at the root of the project, or in the smallweb field of the deno.json[c] file. This config file is optional, and sensible defaults are used when it is not present. A json schema for the config file is available here . You can set it using a $schema field in your smallweb.json[c] file: { "$schema": "https://schema.smallweb.run",
} VS Code users can also set it globally in their settings.json: { "json.schemas": [ { "url": "https://schema.smallweb.run", "fileMatch": [ "smallweb.json", "smallweb.jsonc" ] } ]
}

